  const screen = useScreen();
  const Screen = screens[screen];
  return (
    <div className="App">
      <h1>Weather App</h1>

      <form>
        <label>
          Zip Code
          <input type="text" name="zipcode" />
        </label>
        <input type="submit" value="Enter" />
      </form>

    </div>
  );
}

export default App;
